import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <nav className="navbar">
            <div className="container">
                <Link to="/" className="brand">MyBlog</Link>
                <div className="links">
                    <Link to="/">Home</Link>
                    <Link to="/contact">Contact</Link>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
